import React from 'react'
import data from './data'

const Projects = () => {
    const {id, img} = data;

    return (
        <section id='projects'>
            <div className="container">
                <h2>Projects</h2>
                {data.map((item) => {
                    <img src={item.img} alt="" />
                })} 
            </div>
        </section>
    )
}

export default Projects
